import React, { Component } from 'react';
import { HeaderWrapper, Logo } from './style'
import logoPic from '../../statics/logo.png'


class Header extends Component {
    render() {
        return(
            <HeaderWrapper>
                <Logo />
            </HeaderWrapper>
        )
    }
}

export default Header
